@Component({
  selector: 'app-img',
  templateUrl: './img.component.html',
  styleUrls: ['./img.component.scss']
})
export class ImgComponent {
  @Input()  img : string  = "nuestro primer string";
  imgDefault="../../../assets/images/default.png";
  imgError(){
    this.img=this.imgDefault;
  }
}
